import React from 'react';

function RegistrationBanner() {
  return (
    <div className="registration-banner">
      <h2>Junte-se a nós!</h2>
      <p>Registre-se como doador ou instituição para fazer a diferença.</p>
      <div className="registration-buttons">
        <button className="btn-donor">Cadastrar como Doador</button>
        <button className="btn-institution">Cadastrar como Instituição</button>
      </div>
    </div>
  );
}

export default RegistrationBanner;
